import React from "react";
import "../styles/Scard.css";
const Scard = () => {
  return (
    <div className="sbox">
      <div className="scard">
        <div>
          <p>You have requested x to send the address</p>
        </div>
        <button className="btn status">
          <span>status:</span>
          <span>pending</span>
        </button>
        <button className="btn edit">
          <span>edit</span>
        </button>
      </div>
    </div>
  );
};

export default Scard;
